let frame = -1;
const tailLength = 15;
const colors = 'orange green purple cyan'.split(' ')
const timer = setInterval(()=>{
    let data = progress[++frame];
    if (!data) return clearInterval(timer);
    ctx.clearRect(0, 0, can.width, can.height)
    ctx.globalAlpha = 1
    let [vars, round, curx, cury, bestx, besty, temp] = data;
    variations.innerHTML = vars;
    resets.innerHTML = round-1;
    temperature.innerHTML = temp.toFixed(2)+"°"
    best.innerHTML = ((20-besty)/5).toFixed(3)

    for (var i=0; i<tailLength; ++i) {
        data = progress[frame-i];
        if (!data) break;
        [, round, curx, cury] = data;
        ctx.globalAlpha = 1-(i/tailLength);
        plot(curx, -cury, colors[(round-1)%colors.length])
    }
    ctx.globalAlpha = 1
    plot(bestx, -besty, 'red')
},10);

function plot(vx,vy,style) {
    vy = (20+vy)/5
    const [x,y] = xy(vx, vy)
    ctx.fillStyle = style
    ctx.fillRect(x-5, y-5, 11, 11)
}
